import React from 'react';
import '../styles/UserDataCard.css'; // import CSS file

function UserDataCard(props) {
  return (
    <div className="container">
    <div className="user-data-card">
      <img className="user-avatar" src={props.avatarUrl} alt="user avatar" />
      <div className="user-details">
        <h2 className="user-name">{props.name}</h2>
        <p className="user-email">{props.email}</p>
        <p className="user-phone">{props.phone}</p>
        <p className="user-website">{props.website}</p>
      </div>
    </div>
    </div>
  );
}

export default UserDataCard;
